@-moz-document domain('tumblr.com'), url-prefix('http://www.tumblr.com/') , url-prefix("https://www.tumblr.com/") {









#nav .nav_item.active {

    background: rgba(0,0,0,0.5) !important;

  }





#dashboard_index{ background: url('http://27.media.tumblr.com/tumblr_l3dm1slqFQ1qbollxo1_500.jpg') bottom right #ffffff no-repeat fixed !important;}











#dashboard_index #left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {

    background: rgba(0,0,0,0.2) !important;

  }











